import (
	context "context"
	fern "github.com/file-upload-openapi/fern"
	fernclient "github.com/file-upload-openapi/fern/client"
)

client := fernclient.NewClient()
response, err := client.FileUploadExample.UploadFile(
	context.TODO(),
	&fern.UploadFileRequest{
		Name: "name",
	},
)
